import StarRatings from "react-star-ratings";
import React,{useState} from 'react'
import _ from 'lodash' 

var ratings={}
const StarRating = (props) => {
    const [rate, setRate] = useState(0)
    const handleRating = async (newRating, name) => {
        name = name.split('+')
      _.set(ratings, [name[0], name[1]], newRating)
      // ratings={...ratings,opinion:document.getElementById(props.label.split('+')[0])}
      _.set(ratings,name[0],document.getElementById(name[0]).value)
      setRate(newRating)
      log
      props.onChange(ratings)
      }
  return (
          <StarRatings
            rating={rate}
            numberOfStars={5}
            changeRating={handleRating}
            starDimension={30}
            starSpacing={0}
            starRatedColor={'rgb(253, 236, 1)'}
            starEmptyColor={'rgb(109, 122, 130)'}
            starHoverColor={'rgb(253, 1, 1)'}
            name={props.label}
          />
  )
}
export {StarRating}
